import React, {useContext} from "react";
import "./Test.css"
import { useForm } from 'react-hook-form';
import {useState} from "react";



function Test(){
    const { handleSubmit } = useForm();
    function onFormSubmit(data) {
        console.log(data.uur);

    }
    const [counter, setCounter] = useState(0)
    const handleClick1 = () => {
        setCounter(counter + 1)
    }

    const handleClick2 = () => {
        setCounter(counter - 1)
    }

    return(
        <>

            <div style={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '300%',
                position: 'absolute',
                width: '100%',
                height: '100%',
                top: '-15%',
            }}>
                Counter App
                <div style={{
                    fontSize: '120%',
                    position: 'relative',
                    top: '10vh',
                }}>
                    {counter}
                </div>
                <div className="buttons">
                    <button style={{
                        fontSize: '60%',
                        position: 'relative',
                        top: '20vh',
                        marginRight: '5px',
                        backgroundColor: 'green',
                        borderRadius: '8%',
                        color: 'white',
                    }}
                            onClick={handleClick1}>Increment</button>
                    <button style={{
                        fontSize: '60%',
                        position: 'relative',
                        top: '20vh',
                        marginLeft: '5px',
                        backgroundColor: 'red',
                        borderRadius: '8%',
                        color: 'white',
                    }}
                            onClick={handleClick2}>Decrement</button>
                </div>
            </div>



        </>
    )

};

export default Test
